import ImageOne from '../Images/Hamburger.jpg';
import ImageTwo from '../Images/pizza.jpg';
import ImageThree from '../Images/sandwich.jpg';

export const SliderData=[
    {
        title:'Hamburger',
        price:'20$',
        path:'/homes',
        label:'View Home',
        image:ImageOne,
        alt:'Hamburger'
    },
    {
        title:'Hamburger',
        price:'20$',
        path:'/homes',
        label:'View Home',
        image:ImageTwo,
        alt:'Hamburger'
    },
    {
        title:'Hamburger',
        price:'20$',
        path:'/homes',
        label:'View Home',
        image:ImageThree,
        alt:'Hamburger'
    }
]
